const employeeData = [
  {
    "first_name": "Alice",
    "last_name": "Adams",
    "devices": [1, 2]
  },
  {
    "first_name": "Bob",
    "last_name": "Bush",
    "devices": [3]
  },
  {
    "first_name": "Chris",
    "last_name": "Carlton",
    "devices": [4]
  },
  {
    "first_name": "Dorian",
    "last_name": "Descartes",
    "devices": [5, 6]
  },
  {
    "first_name": "Esteban",
    "last_name": "Enriquez",
    "devices": [7, 8]
  }
];

const countEmployees = (data) => {
  let counter = 0;
  data.forEach((employee) => {
    counter++;
  });
  return counter;
};

const countDevices = (data) => {
  let counter = 0;
  data.forEach((employee) => {
    let count = employee.devices.length
    counter += count;
  });
  return counter;
}

export {
  employeeData,
  countEmployees,
  countDevices
};
